// MainPage.jsx
import React from 'react';
import { useNavigate } from 'react-router-dom';
import './mainpage.css';
import heading from './assets/25637.png algo\src\assets\heading.png ';
import Background from './Background';

const MainPage = () => {
  const navigate = useNavigate();

  const handleVisualizerClick = () => {
    navigate('/visualizer');
  };

  return (
    <div className="mp">
      <Background/>
      <img src="algo/src/heading.png" alt="Letter Heading" style="height: 100px; width: auto;"></img>
      <h1>ALGORITHM VISUALISER</h1>
      <button className = "direct" onClick={handleVisualizerClick}>Get Started</button>
    </div>
  );
};

export default MainPage;
